import axios from "axios";
import { value } from '../pages/SignUp';

export const currentUser = async () => {
  let foo = {value};
  let fooURL = 'http://localhost:5000/users/' + foo;
axios({
  method: 'get',
  url: fooURL,
  transformResponse: [function (data) {
    // Do whatever you want to transform the data

    return data;
  }],
})

};
